import React from "react";
import { Carousel } from "react-bootstrap";
import autosalon from "../src/photoauto/autosalon.jpg";
import salonauto from "../src/photoauto/salonauto.jpg";
import auto from "../src/photoauto/auto.jpg";

const Main = () => {
  return (
    <Carousel className="py-3">
      <Carousel.Item>
        <img
          className="d-block w-100 h-200"
          src={autosalon}
          alt="First slide"
        />
        <Carousel.Caption>
          <h1>Контакты и адреса</h1>
          <p>Саратов</p>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <img className="d-block w-100 h-80" src={salonauto} alt="First slide" />
        <Carousel.Caption>
          <h1>Контакты и адреса</h1>
          <p>Саратов</p>
        </Carousel.Caption>
      </Carousel.Item>
      <Carousel.Item>
        <img className="d-block w-100 h-80" src={auto} alt="First slide" />
        <Carousel.Caption>
          <h1>Контакты и адреса</h1>
          <p>Саратов</p>
        </Carousel.Caption>
      </Carousel.Item>
    </Carousel>
  );
};
export default Main;
